window.bookSummaryJSON = "<p><b>The manhunt has officially begun.</b></p> <p>Now the target of a game-wide Holy War, Ned is forced to flee the Onyx Sands.</p> <p>The odds are stacked against him; Tyrann has tens of thousands of followers, a religion that’s spreading like wildfire, and a powerful god that will be stepping into the world of EBO in a matter of days.</p> <p>Meanwhile, Ned’s allies are a squirrel-exploding bard, a repurposed home security system who takes her instructions far too literally, and a wildly unreliable talking axe named Frank.</p> <p>But even as the inevitable conflict draws closer, change is coming to EBO. An old power is stirring, bringing with it strange new enemies, fearsome challenges, and rewards that every player will be vying to obtain.</p> <p><b>There will be blood.</b></p> <p><b>Not enough for Frank, but a very substantial amount.</b></p>"; 
